import React, { useState } from 'react';
import { ArrowUpIcon, Microphone, Paperclip } from "@phosphor-icons/react";
import Frame5 from "../Images/Frame5.png";
import axios from "axios";

const Middle = () => {
  const [selected, setSelected] = useState("Search");
  const options = ['Search', 'Compare', 'Cost Estimate'];
  const [query, setQuery] = useState("");
  const [loading, setLoading] = useState(false);
  const [response, setResponse] = useState("");

  const handleSend = async () => {
    if (!query.trim()) return;

    setLoading(true);
    try {
      const res = await axios.post("http://localhost:8000/chat-with-ai", { query });
      setResponse(res.data.answer || "No response received.");
    } catch (error) {
      setResponse("Something went wrong. Please try again.");
    } finally {
      setLoading(false);
      setQuery("");
    }
  };

  const handleKeyDown = (e) => {
    if (e.key === "Enter") {
      handleSend();
    }
  };

  return (
    <div
      style={{
        borderRadius: "12px",
        boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.1)",
        backgroundColor: "#FAFAFA",
        height: "96vh",
        width: "100%",
        backdropFilter: "blur(32px)",
        marginTop: "20px",
        marginBottom: "20px",
        position: "relative"
      }}
    >
      <div style={{ display: "flex", marginTop: "30px", justifyContent: "center" }}>
        <img src={Frame5} style={{ width: '18px', height: '18px', marginTop: "2.5px" }} alt="Logo" />
        <div style={{ fontSize: "18px", marginLeft: "6px" }}>Insurio</div>
      </div>

      <div style={{ display: "flex", justifyContent: "center", alignItems: "center", flexDirection: "column", marginTop: "160px" }}>
        <img src={Frame5} style={{ width: '22px', height: '22px' }} alt="icon" />
        <div style={{ color: "#A0A0A0", fontSize: "16px", marginTop: "8px" }}>Welcome to Insurio</div>
        <div style={{ color: "#000000", fontSize: "38px", marginTop: "8px" }}>How can I Help ?</div>
        {loading ? (
          <div style={{ marginTop: "20px", color: "#A0A0A0" }}>Thinking...</div>
        ) : (
          response && <div style={{ marginTop: "20px", color: "#333", maxWidth: "60%", textAlign: "center" }}>{response}</div>
        )}
      </div>

      <div
        style={{
          paddingLeft: "12px",
          paddingRight: "12px",
          backgroundColor: "#F0F0F0",
          borderRadius: "12px",
          position: "fixed",
          bottom: "6%",
          left: "50%",
          transform: "translateX(-50%)",
          width: "40%",
          border: "1px solid #E0E0E0",
        }}
      >
        <div style={{ display: "flex", marginBottom: 0, marginTop: "14px" }}>
          <input
            type="text"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            onKeyDown={handleKeyDown}
            placeholder="Ask about any coverage"
            style={{
              flex: 1,
              borderRadius: "8px",
              backgroundColor: "#f0f0f0",
              marginRight: "10px",
              border: "none",
              fontSize: "16px",
              color: "#000000",
              transition: "background 0.3s",
              outline: "none",
            }}
          />
          <div
            onClick={handleSend}
            style={{
              width: "26px",
              height: "26px",
              borderRadius: "100px",
              background: "#000000",
              color: "#A0A0A0",
              border: "none",
              cursor: "pointer",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <ArrowUpIcon size={20} color="#FFF" weight="bold" />
          </div>
        </div>

        {/* Clickable Options */}
        <div style={{ display: "flex", gap: "8px", justifyContent: "space-between" }}>
          <div style={{ display: "flex", gap: "8px", justifyContent: "flex-start" }}>
            {options.map((label) => {
              const isSelected = selected === label;
              return (
                <p
                  key={label}
                  onClick={() => setSelected(label)}
                  style={{
                    border: "1px solid",
                    borderColor: isSelected ? "#ECB26B3D" : "#E0E0E0",
                    marginBottom: "12px",
                    marginTop: "21px",
                    textAlign: "center",
                    padding: "10px 16px",
                    color: isSelected ? "#ECB26B" : "#A0A0A0",
                    borderRadius: "10px",
                    backgroundColor: isSelected ? "rgba(236, 178, 107, 0.24)" : "#FAFAFA",
                    display: "flex",
                    alignItems: "center",
                    cursor: "pointer",
                    transition: "all 0.3s",
                    userSelect: "none",
                    fontSize: "16px",
                  }}
                >
                  {label}
                </p>
              );
            })}
          </div>
          <div style={{ display: "flex", gap: "8px", justifyContent: "flex-start" }}>
            <div style={{ display: "flex", alignItems: "center", marginTop: "21px", padding: "10px 0", marginBottom: "12px" }}>
              <Microphone size={20} color="#A0A0A0" weight='fill' />
            </div>
            <div style={{ display: "flex", alignItems: "center", marginTop: "21px", padding: "10px 0", marginBottom: "12px" }}>
              <Paperclip size={20} color="#A0A0A0" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Middle;
